const data = [
  {
    id: 1,
    name: "Gram"
  },
  {
    id: 2,
    name: "Pieces"
  },
  {
    id: 3,
    name: "Kilogram"
  },
  {
    id: 4,
    name: "Liter"
  },
  {
    id: 5,
    name: "Kilobyte"
  },
  {
    id: 6,
    name: "Kilobyte"
  },
  {
    id: 7,
    name: "Kilobyte"
  }
];
export function findByid(id) {
  for (const e of data) {
    if (e.id = id) {
      return e;
    }
  }
}
export function findAll() {
  return data;
}
